import imgDoight from '../../assets/img/doights.svg'
import imgFleche from '../../assets/img/triangles.png'
import carrer from '../../assets/img/carrer.png'

const descriptionImg = ["Representation d'une main orange avec l'index levé.","Representation d'une flêche orange pointant vers le haut et d'une flêche orange pointant vers le bas.","Representation de deux containers oranges suppersposés."]
const src = [imgDoight,imgFleche,carrer];

const tabImg={
    descriptionImg:descriptionImg,
    src:src
}

export default tabImg;
